return (
<div className="P_HomeBG">
    <NavBar/>
  <Container>
  <Row className="rowcenter toprow">
  <Col md={12}>
  <h3>Dummy course ####</h3>
  </Col>
  </Row>
  <hr/>
  <Row>
  <Tab.Container defaultActiveKey="#link1">
  <Row>
    <Col xs={3} md={2}>
      <ListGroup>
        <ListGroup.Item className="expand list layoutbg classmenu" action href="#link1">
          <p>Assignments</p>
        </ListGroup.Item>
        <ListGroup.Item className="expand list layoutbg classmenu" action href="#link2">
          <p>Projects</p>
        </ListGroup.Item>
        <ListGroup.Item className="expand list layoutbg classmenu" action href="#link2">
          <p>Exams</p>
        </ListGroup.Item>
      </ListGroup>
    </Col>
    <Col xs={9} md={10}>
      <Tab.Content>
        <Tab.Pane eventKey="#link1">

        </Tab.Pane>
        <Tab.Pane eventKey="#link2">

        </Tab.Pane>
      </Tab.Content>
    </Col>
  </Row>
</Tab.Container>
  </Row>
      </Container>



</div>
);
}
}

export default GradingPage;
